import './Receipt.css';

function Receipt() {
    return (
        <>
            <h2>결제가 완료 되었습니다.<br/></h2>
            <h1>영수증을<br/>출력하시겠습니까?</h1>
            <div className='coke'>
                <button className='react'>예</button>
                <button className='react'>아니오</button><br/>
            </div>
            <div className='bread'>
                <button className='react'>주문 번호 x번</button>
            </div>
        </>
    );
}

export default Receipt;
